import React from 'react';
import './TeamSection.css';

const TeamMember = ({ name, role }: { name: string; role: string }) => (
  <div className="team-member">
    <div className="team-member-avatar"></div>
    <div className="team-member-info">
      <h3 className="team-member-name">{name}</h3>
      <p className="team-member-role">{role}</p>
    </div>
  </div>
);

const TeamSection = () => {
  const teamMembers = [
    { name: 'Adelin Johari', role: 'CEO & co-ounder', linkedIn: 'https://www.linkedin.com/in/adelin-johari-561a42256/'},
    { name: 'Paraaga Raghavendra', role: 'co-founder', linkedIn: 'https://www.linkedin.com/in/paraaga-raghavendra-84ba3a255/'},
    { name: 'Wen Xin', role: 'Buiness Analyst', linkedIn: 'https://www.linkedin.com/in/wen-xin-foo-788911256/'},
    { name: 'Aqif Yeo', role: 'Product Designer', linkedIn: 'https://www.linkedin.com/in/aqif-yeo-b3b1b1255/'},
    { name: 'Xie Jiacheng', role: 'Mechanical Engineer', linkedIn: 'https://www.linkedin.com/in/xie-jiacheng-b1b1b1255/'},
    { name: 'Jignesh Motwani', role: 'Software Engineer', linkedIn: 'linkedin.com/in/jigneshmotwani'},
  ];

  return (
    <div className="team-section">
      <h2 className="team-section-title">Our Team</h2>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <TeamMember key={index} name={member.name} role={member.role} />
        ))}
      </div>
    </div>
  );
};

export default TeamSection;
